    specific to awards made from the Department of Health and Human Services to Native
    Americans and provides highlights of Native American projects that were impacted
    by HHS funding from 2007-2008. The report contains the descriptions of Staff Divisions
    and Operating Divisions under the Office of the Secretary who have made a significant
    impact on Native Americans (Tribes, both federally recognized and state recognized,
    Alaska Natives, Native Hawaiians and Pacific Islanders located in Guam, American
